import React,{useState,useEffect} from"react"
import axios from "axios";
import { useParams } from 'react-router-dom';

export default function UpdateVehicle() {
    const { id } = useParams();
    const trimmedId = id.trim();

    const [txtBrand, setBrand] = useState();
    const [txtModel, setModel] = useState();
    const [txtType, setType] = useState();
    const [txtYear, setYear] = useState();
    const [txtFeatures, setFeatures] = useState();
    const [txtFuelType, setFuelType] = useState();
    const [txtPricePerDay, setPricePerDay] = useState();
    const [txtReg,setReg]=useState();
    const [txtTransmission,setTrans]=useState();
    const [txtAvai,setAvai]=useState();
    const [fileImage, setImage] = useState();


      useEffect(() => {
        console.log(trimmedId);
        axios.get(`http://localhost:6060/Vehicle/get/${trimmedId}`)
          .then((res) => {
            console.log("API Response:", res.data);
            
            const vehicleData = res.data.Vehicle; // Assuming Vehicle is the key containing the vehicle data
      
            // Update state variables with fetched data
            setBrand(vehicleData.brand);
            setModel(vehicleData.model);
            setType(vehicleData.type);
            setYear(vehicleData.year);
            setFeatures(vehicleData.features);
            setFuelType(vehicleData.fuelType);
            setPricePerDay(vehicleData.priceperday);
            setReg(vehicleData.regnumber);
            setTrans(vehicleData.transmission);
            setAvai(vehicleData.availability);
            setImage(vehicleData.image);
            alert('Vehicle  found');
          })
          .catch((err) => {
            if (err.response && err.response.status === 404) {
              alert('Vehicle not found');
            } else {
              alert('Error fetching vehicle details');
              console.error(err); // Log the full error for debugging
            }
          });
      },[])
    
    
    

  
    
    
   
    return(
        <div style={{ fontFamily: 'Arial, sans-serif', maxWidth: '850px', margin: '0 auto' }}>
           <h1>Update Vehicle Details for ID: {id}</h1>
        <form  style={{ padding: '20px', border: '1px solid #ccc', borderRadius: '8px', background: '#f9f9f9' }}>
            <div>
            {/* Brand, Model, and Year */}
            <div style={{ display: 'flex', gap: '30px', marginBottom: '30px' }}>
                <div>
                <label>Brand: </label>
                <select name="Brand" id="txtBrand" value={txtBrand} onChange={(e) => {
                    setBrand(e.target.value);
                }}>
                    <option value="volvo">Volvo</option>
                    <option value="saab">Saab</option>
                    <option value="mercedes">Mercedes</option>
                    <option value="audi">Audi</option>
                </select>
                </div>
                <div>
                <label>Model:</label>
                <input type="text" id="txtModel" value={txtModel}  onChange={(e) => {
                    setModel(e.target.value);
                }} />
                </div>
                <div>
                <label>Year:</label>
                <input type="text" id="txtYear" value={txtYear} onChange={(e) => {
                    setYear(e.target.value);
                }} />
                </div>
            </div>

            {/* Type, Transmission, and Availability */}
            <div style={{ display: 'flex', gap: '30px', marginBottom: '30px' }}>
                <div>
                <label>Type:</label>
                <select name="Type" id="txtType" value={txtType} onChange={(e) => {
                    setType(e.target.value);
                }}>
                    <option value="suv">SUV</option>
                    <option value="sport">Sport</option>
                    <option value="luxury">Luxury</option>
                </select>
                </div>
                <div>
                <label>Transmission:</label>
                <select name="Transmission" id="txtTransmission" value={txtTransmission} onChange={(e) => {
                    setTrans(e.target.value);
                }}>
                    <option value="Auto">Auto</option>
                    <option value="Manual">Manual</option>
                </select>
                </div>
                <div>
                <label>Availability:</label>
                <select name="Availability" id="txtAvai" value={txtAvai} onChange={(e) => {
                    setAvai(e.target.value);
                }}>
                    <option value="rent">Rent</option>
                    <option value="free">Free</option>
                </select>
                </div>
            </div>

            {/* Fuel Type, Seats, and Price Per Day */}
            <div style={{ display: 'flex', gap: '30px', marginBottom: '30px' }}>
                <div>
                <label>Fuel Type:</label>
                <select name="FuelType" id="txtFuelType" value={txtFuelType} onChange={(e) => {
                    setFuelType(e.target.value);
                }}>
                    <option value="petrol">Petrol</option>
                    <option value="diesel">Diesel</option>
                    <option value="electric">Electric</option>
                </select>
                </div>
                <div>
                <label>Seats:</label>
                <input type="text" id="txtFeatures" value={txtFeatures} onChange={(e) => {
                    setFeatures(e.target.value);
                }} />
                </div>
                <div>
                <label>Price Per Day:</label>
                <input type="text" id="txtPricePerDay" value={txtPricePerDay} onChange={(e) => {
                    setPricePerDay(e.target.value);
                }} />
                </div>
            </div>

            {/* Image upload */}

            <div style={{ display: 'flex', gap: '30px', marginBottom: '30px' }}>
            <div>
                <label>Reg-No:</label>
                <input type="text" id="txtReg" value={txtReg} onChange={(e) => {
                    setReg(e.target.value);
                }} />
                </div>
                <div>
                <label>Image:</label>
                <input type="file" id="fileImage" value={fileImage} onChange={(e) => {
                    const selectedFile = e.target.files[0];
                    setImage({selectedFile});
                }} />
                </div>
            </div>

            {/* Submit button */}
            <div class="col-auto">
                <button type="submit" class="btn btn-primary mb-3" id="submit">Submit</button>
            </div>
            </div>
        </form>
        </div>

    )
}
